/**
 * RpcPrimitive
 */
'use strict';
module.exports = RpcPrimitive;
var RpcObject = require('./RpcObject.js');
var util = require('util');
function RpcPrimitive(type)
{
	RpcObject.call(this, type);
}

util.inherits(RpcPrimitive, RpcObject); 

RpcPrimitive.prototype.isPrimitive = function()
{
	return true;
};
